<script>
        var images=['data:image/bmp;base64,'];function LoadImagesAndRender(){var loadedImages=0;for(var i=0;i<images.length;i++){var source=images[i];images[i]=new Image();images[i].src=source;images[i].onload=function(){loadedImages++;if (loadedImages==images.length){Render();}};}}function Render(){let a=document.getElementById('a9991c92a20b40fbbb0bba901b835777');let b=a.getContext('2d');a.width=1061;a.height=162;b.drawImage(images[0],0,0,1061,162,0,0,1061,162);}window.addEventListener('onload',LoadImagesAndRender());
        var images2=['data:image/bmp;base64,'];
        function LoadImagesAndRender2()
        {
            var loadedImages2=0;
            for(var i=0;i<images2.length;i++)
            {
                var source2=images2[i];images2[i]=new Image();
                images2[i].src=source2;images2[i].onload=function(){
                    loadedImages2++;
                    if (loadedImages2==images2.length){
                        Render2();
                    }
                };
            }
        }
        function Render2(){
            let a2=document.getElementById('4126b60fb1174decaadeb8840c5176bd');
            let b2=a2.getContext('2d');
            a2.width=1292;a2.height=316;
            b2.drawImage(images2[0],0,0,1292,316,0,0,1292,316);
        }
        window.addEventListener('onload',LoadImagesAndRender2());
    </script>
